class ASSET():
    def initRelease(self):
        '''释放资源到本地'''
        for dir in _dirList:  # 创建目录
            if not os.path.isdir(dir):
                os.makedirs(dir)
        for im in _ImageDict.values():  # base64保存图片到本地
            if im['isSave'] and not os.path.isfile(im['path']):
                with open(im['path'], 'wb') as f:
                    f.write(base64.b64decode(im['base64']))

    def initTK(self):
        for im in _ImageDict.values():
            if im['isTK']:
                im['tk'] = tk.PhotoImage(data=im['base64'])
            # im['tk'] = tk.PhotoImage(file=im['path'])

    def getImgTK(self, name):
        '''获取名为name的tk图片'''
        return _ImageDict[name]['tk']

    def getPath(self, name):
        '''获取一个项目的路径'''
        return _ImageDict[name]['path']


Asset = ASSET()


def GetTbpuHelp(website):
    return f"""
【文本块后处理】介绍

OCR识别出的文本是按行划分文字块，有时还会将一行误划分为多块。【文本块后处理】就是对文本块再加工，合并同一行或同一段落内的文字。


【横排-优化单行】
将误划分为多块的同一行文字合并到一行。

【横排-合并多行-左对齐】
将多个左对齐的行视为同一段落，合并文字。

【横排-合并多行-自然段】
将多个左对齐的行视为同一段落，且第一行可以比后续行多空出开头两个字符。

【横排-合并多行-模糊匹配】
只要垂直投影有重叠，且行高一致的行，视为同一段落。

【竖排-从左到右-单行】
【竖排-从右至左-单行】
优化竖排识别，合并同一行文字，按从左到右或从右到左的顺序输出每一行。
注意，必须搭配支持竖排识别的模型库（识别语言）一起使用。

【不做处理】
将OCR结果原样输出。


可以在忽略区域编辑器内预览文本块后处理的效果，对比启用不同后处理时文字虚线框的变化。
注意，实际任务时忽略区域早于后处理执行，不受后处理的影响。


更多说明详见GitHub项目主页：
{website}
"""
